<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Email Form</title>
</head>
<body>

    <div>
        <h1>Subscribe via Email</h1>
        <form id="emailForm">
            <label for="email">Email:</label>
            <input type="email" id="email" name="email" value="135.x@ud.me" required>
            <button type="button" onclick="openEmailClient()">Subscribe</button>
        </form>
    </div>

    <script>
        function openEmailClient() {
            // Get the user's entered email
            const emailInput = document.getElementById('email');
            const userEmail = emailInput.value;

            // Construct the mailto link
            const mailtoLink = `mailto:${userEmail}`;

            // Open the default email client
            window.location.href = mailtoLink;
        }
    </script>

</body>
</html>

        <!-- Smooth scrolling -->
<script src="https://ajax.googleapis.com/ajax/libs/jquery/3.4.1/jquery.min.js"></script>
<script>
    // handle links with @href started with '#' only
    $(document).on('click', 'a[href^="#"]', function(e) {
        // target element id
        var id = $(this).attr('href');
    
        // target element
        var $id = $(id);
        if ($id.length === 0) {
            return;
        }
    
        // prevent standard hash navigation (avoid blinking in IE)
        e.preventDefault();
    
        // top position relative to the document
        var pos = $id.offset().top;
    
        // animated top scrolling
        $('body, html').animate({scrollTop: pos});
    });
</script>
